l_english:

 ag_exe_invasion_chain_title:0 "§EThe Eternal Fleet§!"
 ag_exe_invasion_chain_desc:0 "These invaders from extragalactic space seem to make no attempt to communicate with us; they only destroy everything they encounter, until they themselves are destroyed."
 ag_exe_invasion_fleet:0 "§YThe Eternal Fleet§!"
 ag_exe_invasion_planet_destroyed:0 "§YWorlds destroyed by the Eternal Fleet§!"
 ag_exe_invasion_ship_kill_by_us:0 "§GThe Eternal Fleet we destroyed§!"
 ag_exe_invasion_ship_kill_by_other:0 "§GThe Eternal Fleet destroyed by others§!"
 ag_exe_invasion_victim:0 "§RShips destroyed by the Eternal Fleet§!"

 exe_invasion_lock_outer_gate:"§EClose the Gateway§!"
 exe_invasion_lock_outer_gate_DESC:"We may close the Gateways within our borders to increase our preparation time."
 exe_invasion_lock_the_eclipse:"§EThe Eternal Flagship§!"
 exe_invasion_lock_the_eclipse_DESC:"A super-flagship from the Eternal Fleet—we need further research and analysis of its composition. However, this design, reminiscent of Kuat Drive Yards' flagships, seems to hold unknown secrets......................."
 
 ag_shattered_holy_planet:0 "§EThe Once Sacred Land§!"
 ag_shattered_holy_planet_desc:0 "This world was once considered sacred by a certain Fallen Empire, but now only countless wrecks float in orbit. Whatever wealth it once held has long since turned to dust in the catastrophe that came before."
 ag_shattered_holy_planet_custom:0 "This world was once considered sacred by a Fallen Empire before it was shattered."

 exe_outer_gate_locked:"§E$exe_outer_gate$§!"
 exe_outer_gate_locked_DESC:"A strange Gateway that has already been locked by us."

 exe_outer_gate_disable:"§E$exe_outer_gate$§!"
 exe_outer_gate_disable_MEGASTRUCTURE_DETAILS:"$exe_outer_gate_disable_DESC$"
 exe_outer_gate_disable_DESC:"A strange Gateway that has already been locked."

 bombardment_exe_invasion_bombardment:0 "§EEternal Bombardment§!"
 bombardment_exe_invasion_bombardment_desc:0 "The orbital bombardment weapons aboard Eternal Fleet warships can cause massive damage to planets.\n- Inflicts §Rlethal§! damage on §YArmies§!.\n- Inflicts §Rlethal§! damage on §YPlanets§!.\n- Inflicts §Rlethal§! damage on §YPops§!.\n- Will bombard undefended planets.\n- A planet will be §Rcompletely destroyed§! if its devastation reaches §R100§! or the §Ytotal population§! of £pop£ is §Rno more than 1§!."
